export default {
  name: 'HighlighterBar',
  props: {
    visible: {
      type: Boolean,
      default: false,
      required: true
    },
    enable: {
      type: Boolean,
      default: false,
      required: true
    }
  },
  data: function data() {
    return {
      highlighterStylesClassName: ['highlighterStyles-red', 'highlighterStyles-skyblue', 'highlighterStyles-yellow', 'highlighterStyles-greed', 'highlighterStyles-gray', 'highlighterStyles-pink', 'highlighterStyles-blue', 'highlighterStyles-purple']
    };
  },
  methods: {
    closeHighlighterBar: function closeHighlighterBar() {
      this.$emit('changeVisible', false);
    },
    toggleEnable: function toggleEnable() {
      this.$emit('changeEnable');
    },
    handleClick: function handleClick(index) {
      this.$refs['border'].forEach(function (item) {
        return item.classList.remove('active');
      });
      this.$refs['border'][index].classList.add('active');
      this.$emit('changeHighlighterStyle', this.highlighterStylesClassName[index]);
    }
  },
  mounted: function mounted() {
    this.handleClick(0);
  }
};
